import React, { Component, Fragment } from 'react'

export default class Contact extends Component {
    render () {
        return (
            <Fragment>
                <section id="contact">
                    <div class="container-grey no-flex">
                        <h1>Contact me!</h1>
                        <p>e-mail: <a href = "mailto: karolina.shi@outlook.com">karolina.shi@outlook.com</a></p>
                    </div>
                </section>
            </Fragment>
        )
    }
}
